var DocCheck = document.URL;
var decch = DocCheck.indexOf("trade") != -1;
if (decch == true) {
    var masterString = document.body.innerHTML;
    var result = masterString.split('steam://friends/add/')[1].split('" data-tipsy="Add on Stea')[0];
    var Imagenormal = 'data:image/jpeg;base64,'
    var ImagenormalBackpack = 'data:image/png;base64,'
    var ImagenormalOut = 'data:image/jpeg;base64,'
    var ImagenormalOutBackpack = 'data:image/jpeg;base64,'

        function Openprofile() {
            window.open('http://steamcommunity.com/profiles/' + result)
        }

        function OpenprofileBackpack() {
            window.open('http://backpack.tf/profiles/' + result)
        }

        function ChangeImageBackpack() {
            btn2.setAttribute('src', ImagenormalBackpack);
        }

        function ChangeImageOutBackpack() {
            btn2.setAttribute('src', ImagenormalOutBackpack);
        }

        function ChangeImage() {
            btn1.setAttribute('src', Imagenormal);
        }

        function ChangeImageOut() {
            btn1.setAttribute('src', ImagenormalOut);
        }
    var btn2 = document.createElement('img');
    with(btn2) {
        if (btn2.addEventListener) {
            btn2.addEventListener('mouseover', ChangeImageBackpack, false);
            btn2.addEventListener('mouseout', ChangeImageOutBackpack, false);
            btn2.addEventListener('click', OpenprofileBackpack, false);
        }
        btn2.setAttribute("style", "cursor: Pointer");
        btn2.setAttribute("onmouseover", 'OpenprofileBackpack');
        btn2.style.marginBottom = "-5px"
        btn2.setAttribute('src', ImagenormalOutBackpack);
        btn2.setAttribute('type', 'button');
    }

    // Steam Account Button
    var btn1 = document.createElement('img');
    with(btn1) {
        if (btn1.addEventListener) {
            btn1.addEventListener('mouseover', ChangeImage, false);
            btn1.addEventListener('mouseout', ChangeImageOut, false);
            btn1.addEventListener('click', Openprofile, false);
        }
        btn1.setAttribute("style", "cursor: Pointer");
        btn1.setAttribute("onmouseover", 'Openprofile');
        btn1.style.marginBottom = "-5px"
        btn1.setAttribute('src', ImagenormalOut);
        btn1.setAttribute('type', 'button');
    }

    document.getElementsByTagName('ul')[8].appendChild(btn2);
    document.getElementsByTagName('ul')[8].appendChild(btn1);
}


